import React from 'react';
import {Signup} from "./components/signup";
import {Signin} from "./components/signin"
import {Link, Router} from "react-router-dom";

function App() {
  return (
      <Router>
          <div>
              <Link to="signin">

              </Link>
              <Signup/>
              <Signin/>
          </div>
      </Router>

  );
}

export default App;
